import {Card, CardActionArea, CardContent, CardMedia, Divider, Grid, Typography} from "@mui/material";
import React from "react";
import '../App.css';
import vote from "../imgs/vote.png"
import personalData from "../imgs/personaldata.png"
import iniziative from "../imgs/iniziative.png"
import "@fontsource/ubuntu-mono";
import logo_CivicLife from '../imgs/logo_CivicLife.png';
import {Navigate, useLocation, useNavigate} from "react-router-dom";

const MainPage = () => {
    const location = useLocation()
    const navigate = useNavigate()
    const isAdmin = location.state?.isAdmin
    const token = location.state?.token
    if (isAdmin === undefined || token === undefined) {
        console.log('non sei loggato')
        return <Navigate to='/'/>
    }

    const handleOpenPersonalData = () => {
        if (isAdmin) {
            navigate('/usersAdministration', {state: {token: token, isAdmin: isAdmin}})
        } else {
            navigate('/myData', {state: {token: token, isAdmin: isAdmin}})
        }
    }

    const handleOpenInitiatives = () => {
        if (isAdmin) {
            navigate('/initiativesAdministration', {state: {token: token, isAdmin: isAdmin}})
        } else {
            navigate('/initiatives', {state: {token: token, isAdmin: isAdmin}})
        }
    }

    const handleOpenVotations = () => {
        if (isAdmin) {
            navigate('/votationsAdministration', {state: {token: token, isAdmin: isAdmin}})
        } else {
            navigate('/votations', {state: {token: token, isAdmin: isAdmin}})
        }
    }

    return (

        <>
            <Grid container direction="row" spacing={3}>
                <Grid item xs={12} display="flex" justifyContent="center" alignItems="center">
                    <Typography style={{color: 'white', textAlign: 'center', fontSize: '3rem'}}>BENVENUTO
                        USER</Typography>
                </Grid>
                <Grid item xs={6} display="flex" justifyContent="center" alignItems="center">
                    <Card sx={{width: '60%'}} onClick={handleOpenPersonalData}>
                        <CardActionArea>
                            <Grid container direction="column">
                                <Grid item display="flex" justifyContent="center" alignItems="center"
                                      style={{backgroundColor: '#d4e3fc'}}>
                                    <CardMedia
                                        component="img"
                                        image={personalData}
                                        sx={{
                                            width: '60%',
                                        }}
                                        alt="personalData"/>
                                </Grid>
                                <Divider style={{marginTop: '5px'}}/>
                                <Grid item display="flex" justifyContent="center" alignItems="center">
                                    <CardContent>
                                        <Typography gutterBottom variant="h5" component="div">
                                            {isAdmin ? 'Modera utenti' : 'I tuoi Dati'}
                                        </Typography>
                                    </CardContent>
                                </Grid>
                            </Grid>
                        </CardActionArea>
                    </Card>
                </Grid>
                <Grid item xs={6} display="flex" justifyContent="center" alignItems="center">
                    <Card sx={{width: '60%'}} onClick={handleOpenInitiatives}>
                        <CardActionArea>
                            <Grid container direction="column">
                                <Grid item display="flex" justifyContent="center" alignItems="center"
                                      style={{backgroundColor: '#f1f6be'}}>
                                    <CardMedia
                                        component="img"
                                        image={iniziative}
                                        sx={{
                                            width: '70%',
                                        }}
                                        alt="iniziative"/>
                                </Grid>
                                <Divider style={{marginTop: '5px'}}/>
                                <Grid item display="flex" justifyContent="center" alignItems="center">
                                    <CardContent>
                                        <Typography gutterBottom variant="h5" component="div">
                                            {isAdmin ? 'Gestisci iniziative' : 'Iniziative'}
                                        </Typography>
                                    </CardContent>
                                </Grid>
                            </Grid>
                        </CardActionArea>
                    </Card>
                </Grid>
                <Grid item xs={12} display="flex" justifyContent="center" alignItems="center">
                    <Card sx={{width: '30%'}} onClick={handleOpenVotations}>
                        <CardActionArea>
                            <Grid container direction="column">
                                <Grid item display="flex" justifyContent="center" alignItems="center"
                                      style={{backgroundColor: '#ff5d55'}}>
                                    <CardMedia
                                        component="img"
                                        image={vote}
                                        sx={{
                                            width: '45%',
                                        }}
                                        alt="vote"/>
                                </Grid>
                                <Divider style={{marginTop: '5px'}}/>
                                <Grid item display="flex" justifyContent="center" alignItems="center">
                                    <CardContent>
                                        <Typography gutterBottom variant="h5" component="div">
                                            {isAdmin ? 'Inserisci Votazioni' : 'Votazioni'}
                                        </Typography>
                                    </CardContent>
                                </Grid>
                            </Grid>
                        </CardActionArea>
                    </Card>


                </Grid>
            </Grid>
            <Grid item display="flex" alignItems={'center'} sx={{
                width: '100%',
                margin: "auto",
                bottom: 0,
                right: 0
            }}>
                <CardMedia
                    component="img"
                    image={logo_CivicLife}
                    sx={{
                        width: '6%',
                    }}
                    alt="Logo"
                />
                <Typography
                    style={{color: '#feac0d', textAlign: 'center', fontSize: '1.5rem'}}>CivicLife</Typography>
            </Grid>
        </>
    );

}

export default MainPage;
